import styled from '@emotion/styled';
import { Container } from '@mui/material';
import React from 'react';
import Sample from './Assests/AssestPhotoSample.jpg'

import '@fontsource/inter/300.css';
import '@fontsource/inter/400.css';
import '@fontsource/inter/500.css';
import '@fontsource/inter/700.css';

// Styled
const AssestBlock = styled('div')(() => ({
  display: "flex",
  width: 250
}))

const AssestPhoto = styled('div')(({ photo }) => ({
  display: "block",
  backgroundColor: "red",
  width: '100%',
  height: 250,
  borderRadius: '10px',
  overflow: 'hidden',
  backgroundImage: { photo }
}))

// Components
function Assest(Props) {
  return (
    <AssestBlock>
      <AssestPhoto photo={Props.src}>
        {/* <img src={Props.name} alt="sample" /> */}
      </AssestPhoto>
    </AssestBlock>
  )
}

function App() {
  return (
    <Container fixed>
      <h3>Explore</h3>
      <Assest src={Sample} />
    </Container>
  );
}

export default App;
